import './App.css';
import {useState, useEffect} from "react";
//useState hook.
import Axios from "axios";

function App() {
  const [listOfUsers, setListOfUsers] = useState([]);
  const [name, setName] = useState("");
  const [age, setAge] = useState(0);
  const [username, setUsername] = useState("");

  useEffect(() =>{
    //Api call to backend.
    Axios.get("http://localhost:3001/getImages").then((response) => {
      setListOfUsers(response.data); //Access data from api request
    });

  }, []);

  const createUser = () => {
    Axios.post("http://localhost:3001/createImage", {
      name: name, 
      age: age,
      username: username,
    }).then((response) => {
        alert("Image Saved"); //save data to backend from body.
        setListOfUsers([...listOfUsers, {name:name}])
    });
  };

  const loadUser = () => {
    Axios.get("http://localhost:3001/loadImage", {

    });
  };

  return <div className="App">
    <div className="imageDisplay">
      {
        listOfUsers.map((image) => {
          return (
          <div>
            <h1>Name: {image.name}</h1>
            <h1>Age: {image.age}</h1>
            <h1>Username: {image.username}</h1>
          </div>
        );
      })}
    </div>


    <div>
      <input 
        type="text" 
        placeholder="Name..." 
        onChange={(event) => {
          setName(event.target.value);
        }}/>
      <input 
        type="number" 
        placeholder="Age..."
        onChange={(event) => {
          setAge(event.target.value);
        }}/>
      <input 
        type="text" 
        placeholder="Username..."
        onChange={(event) => {
          setUsername(event.target.value);
        }}/>
      <button onClick= {createUser}> Create save </button>
      <button onClick= {loadUser}> Load latest save </button>


    </div>


    <header>
      <h2>My Miniproject</h2>
      <h4>by Mads Pedersen</h4>
    </header>

        <div class="container">
        <aside>

        <ul class="save_list">
          <li> <button class="save button">Save</button></li>
          <li> <button class="save button">Save</button> </li>
        </ul>

        </aside>

        <section>
            <h3>Information</h3>
            <p>This is an attempt at creating a
                webpage by myself. I tried to make
                it so that you can change the images
                and then save it. You can read more
                about what my webpage does in the
                rapport.
            </p>
        </section>
        </div>

      <div class="carousel">
      <button class="carousel_button carousel_button--left is-hidden">
          <img class="img_butt" src="img/left.svg" alt=""/>
      </button>
      <div class="carousel_track-container">
          <ul class="carousel_track">
              <li class="carousel_slide current-slide">
                  <img class="carousel_image" src="img/slide-1.png" alt=""/>
              </li>
              <li class="carousel_slide">
                  <img class="carousel_image" src="img/slide-2.jpg" alt=""/>
              </li>
              <li class="carousel_slide">
                  <img class="carousel_image" src="img/slide-3.jpg" alt=""/>
              </li>
          </ul>
      </div>

    <button class="carousel_button carousel_button--right" alt="">
        <img class="img_butt" src="img/right.svg" alt=""/>
    </button>

    <div class="carousel_nav">
        <button class="carousel_indicator current-slide"></button>
        <button class="carousel_indicator"></button>
        <button class="carousel_indicator"></button>
    </div>

  </div>
</div>



}

export default App;
